import React, { useContext, useMemo } from 'react';
import PropTypes from 'prop-types';
import { getRequestContext } from '../api/Context'

export function MapCalculator({ layout: Layout }) {
  const vehiclesData = useContext(getRequestContext);

  const prepareDisplay = useMemo(
    () => (
      <Layout data={vehiclesData} />
    ), [vehiclesData])

  return (
    <>
      {vehiclesData ? prepareDisplay : null}
    </>
  );
}

MapCalculator.propTypes = {
  layout: PropTypes.func.isRequired,
};

export default MapCalculator;
